import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Stocks from "./pages/Stocks";
import NoMatch from "./pages/NoMatch";




function App() {
  return (
    <React.Fragment>
    <SideBar />
    <Router>
      <div>
        <Switch>
          <Route exact path={["/", "/stocks"]}>
            <Stocks />
          </Route>
          <Route>
            <NoMatch />
          </Route>
        </Switch>
      </div>
    </Router>
    </React.Fragment>

  );
}

export default App;
